/* Manage Styles window
-----------------------------------*/
@-moz-document url-prefix(chrome://stylish/content/stylish.xul), 
		   url-prefix("chrome://stylish/content/manage.xul") 
{ 

/* Remove margins around list */
tree#styles {
	margin: 0 0 3px 0 !important; 
}

/* Change list background to Carbon */
treechildren#styles-children,
treechildren#styles-children::-moz-tree-row{
	background: #333 url("data:image/jpg;base64,") repeat !important;
	color: #ccc !important;
}

/* Selected - blue */
treechildren#styles-children::-moz-tree-row(current) {
	background: blue !important;
	color: #000000 !important; 
}

/* Info at top about changes possibly not showing until you reload */
description#manage-info { 
	display: none !important; 
}

/* Dialog font change */
dialog{ 
	font-size: 11px !important;
	font-family: DejaVu Sans Mono,Tahoma, Arial, Helvetica, sans-serif !important; 
}

/* Filter textbox color and font change */
textbox#filter { 
	-moz-appearance: none !important;
	color: #E8E1BD !important;
	background: #353333 !important; 
	margin: 2px !important;
	padding: 2px !important;
        font-size: 12px !important;
        font-family: DejaVu Sans Mono,Tahoma, Arial, Helvetica, sans-serif !important; 
}
	

/* Changes the enabled/disabled icons - orange */
   treechildren::-moz-tree-checkbox {
      	list-style-image: url("data:image/png;base64,") !important;
}

   treechildren::-moz-tree-checkbox(checked) {
      	list-style-image: url("data:image/png;base64,") !important;
}

}


/* Code Editor
----------------------------------*/
@-moz-document url("chrome://stylish/content/edit.xul") {

/* Dialog font change */
dialog{ 
     	font-size: 11px !important;
     	font-family: DejaVu Sans Mono,Tahoma, Arial, Helvetica, sans-serif !important; 
}

/* Description textbox color and font change - search [edit.xul] */
textbox#findwhat,
textbox#description { 
	-moz-appearance: none !important;
	color: #E8E1BD !important;
	background: #353333 !important;
	margin: 2px !important;
	padding: 2px !important;
    	font-size: 12px !important;
    	font-family: DejaVu Sans Mono,Tahoma, Arial, Helvetica, sans-serif !important; 
}
	 
/* Remove margins and padding around textbox and dialog
Change text and background colors */
textbox#code { 
	-moz-appearance: none !important;
	color: #ddd !important;
	background: #333 url("data:image/jpg;base64,") repeat !important;
	margin: 0 !important;
	padding: 0 !important;
    	font-size: 12px !important;
    	font-family: DejaVu Sans Mono,Tahoma, Arial, Helvetica, sans-serif !important; 
}

dialog#stylish {
	padding: 0 !important; 
}

/* Remove link to userstyles.org */
/*label#style-url-link { 
	display: none !important; 
}*/

/* Remove top margin on bottom buttons */
.dialog-button { 
	margin-top: 3px !important;
	margin-right: 1px !important;
	margin-left: 1px !important; 
}

/* Move Insert button to the left a little (couldn't figure out a good selector for this) */
hbox + hbox > button { 
    	margin-left: 1px !important;
}

	
}
